FAQs:
{'Khách sạn Cà Ná cách trung tâm Phan Rang bao xa?': 'Khách sạn Cà Ná cách trung tâm Phan Rang 28 km.
Tất cả khoảng cách được đo theo đường thẳng. Khoảng cách di chuyển thực sự có thể khác.', 'Khách sạn Cà Ná có những loại phòng nào?': 'Lựa chọn phòng tại Khách sạn Cà Ná bao gồm: Phòng 3 người, Phòng 2 giường đơn Phòng 4 người', 'Khách sạn Cà Ná có nhà hàng trong khuôn viên không?': 'Khách sạn Cà Ná có 2 nhà hàng: nhà hàng khách sạn cà nácà ná quán', 'Tôi có thể làm gì ở Khách sạn Cà Ná?': 'Khách sạn Cà Ná có những hoạt động/dịch vụ sau (có thể áp dụng phí): Lặn với ống thởSân tennis, Giáp biển, Thiết bị dành cho tennis, Bữa tối theo chủ đề, Thiết bị dành cho cầu lông, Bãi biển, Khu vực bãi tắm riêng', 'Chi phí nghỉ tại Khách sạn Cà Ná là bao nhiêu?': 'Giá tại Khách sạn Cà Ná có thể khác nhau tùy vào kỳ nghỉ của bạn (ví dụ: ngày bạn chọn, chính sách khách sạn,v.v.). Vui lòng xem giá bằng cách nhập ngày của bạn.', 'Khách sạn Cà Ná có phục vụ dạng bữa sáng nào?': 'Khách lưu trú tại Khách sạn Cà Ná có thể tận hưởng bữa sáng được đánh giá cao trong kỳ nghỉ của họ (điểm đánh giá của khách: 2.5)

Lựa chọn bữa sáng bao gồm: Kiểu Á, Tự chọn', 'Khách sạn Cà Ná có giờ nhận và trả phòng như thế nào?': 'Khách sạn Cà Ná có giờ nhận phòng từ 12:00 và giờ trả phòng trước 11:30.'}
